text:
@cnnopinion asked readers whether fraternities and all-male institutions are obsolete. cnn opinion recently published an op-ed by #alexandrarobbins, the author of "pledged," an in-depth look at sorority life, and a new book, "fraternity," which turns a similar lens on young men. robbins argues that 21st-century, post-#metoo efforts toward gender equality too often conflate fraternities with the #toxicmasculinity that she says many of them actively work to disrupt by giving young men an outlet for friendship and vulnerability.

we wanted to know what you think, so we included a call-out to readers to write in with their own experiences and opinions about fraternities and about the slogans, "boys will be boys," and "smash the patriarchy." and weigh in you did, with commentary that ran the gamut, from fraternity alums across generations to a single mom raising her son in a world too filled with #genderviolence.

https://amp.cnn.com/cnn/2019/02/16/opinions/robbins-response-fraternities-letters-to-the-editor-opinion/index.html?__twitter_impression=true

